2,0),(291,232,7,'大红富士苹果',1,0,8,30,2,5,'http://shopimg.qiniudn.com/add:1425966779.706563:0','富士苹果的特点是体积很大，遍体通红，形状很圆，平均大小如棒球一般。果实的重量中，有9－11%是单糖，而且其果肉紧密，比其他很多苹果变种都要甜美和清脆，因此受到全世界消费者的广泛喜爱。',1,0),(292,232,60,'龙眼',1,0,5,20,2,5,'http://shopimg.qiniudn.com/add:1425966935.5800347:0','桂圆又名龙眼，味甜，性平，含有硫胺素  核黄素，尼克酸，抗坏血酸等化学成分。具有安神定志，养血安胎的功效。适用于失眠健忘，脾虚腹泻，精神不振等症状。',1,0),(293,232,19,'冰糖橙',1,0,5,30,2,5,'http://shopimg.qiniudn.com/add:1425967071.1629846:0','冰糖橙含有丰富的VC、对于补充人体水分有良好的成效。能增强人体抵抗力。还具有生津止渴、开胃下气帮助消化，防治便秘的功效。正常人饭后食橙子或饮橙汁，有解油腻、消积食、止渴、醒酒的作用。',1,0),(294,232,19,'血橙',1,0,9,30,2,5,'http://shopimg.qiniudn.com/add:1425967195.0906267:0','功效：1、促进血液循环改善贫血的补血良品2、促进血液循环的最佳精油，有效改善人体的贫血状况；3、能温润补血，改善手脚冰冷；4、对改善肤色，促进皮肤细胞再生，且具清新的香味；\n5、能振奋思考及情绪。',1,0),(295,232,19,'脐橙',1,0,8,30,2,5,'http://shopimg.qiniudn.com/add:1425967316.3044002:0','橙子含有大量维生素C和胡萝卜素，可以抑制致癌物质的形成，还能软化和保护血管，促进血液循环，降低胆固醇和血脂。橙性微凉，味甘、酸，具有生津止渴，开胃下气的功效。',1,0),(296,232,33,'菠萝',1,0,20,40,3,5,'http://shopimg.qiniudn.com/add:1425967493.6945558:0','菠萝味甘、微酸，性微寒，有清热解暑、生津止渴、利小便的功效，可用于伤暑、身热烦渴、腹中痞闷、消化不良、小便不利、头昏眼花等症。而且在果汁中，还含有一种跟胃液相类似的酵素，可以分解蛋白，帮助消化。',1,0),(297,232,14,'小红番茄',1,0,3,15,2,5,'http://shopimg.qiniudn.com/add:1425967692.3360047:0','番茄具有止血、降压、利尿、健胃消食、生津止渴、清热解毒、凉血平肝的功效。番茄汁对肌肤的有着很好的滋补作用。对祛斑有较好的作用。番茄红素可保护人体不受香烟和汽车废气中致癌毒素的侵害。',1,0),(298,232,14,'小黄番茄',1,0,5,20,2,5,'http://shopimg.qiniudn.com/add:1425967919.0723698:0','番茄具有止血、降压、利尿、健胃消食、生津止渴、清热解毒、凉血平肝的功效。番茄汁对肌肤的有着很好的滋补作用。对祛斑有较好的作用。番茄红素可保护人体不受香烟和汽车废气中致癌毒素的侵害。',1,0),(299,232,36,'芦柑',1,0,4,20,2,5,'http://shopimg.qiniudn.com/add:1425968015.7301104:0','芦柑果实硕大，色泽鲜艳，皮松易剥，肉质脆嫩，汁多化渣；味道芳香甘美，食后有香甜浓蜜之感，风味独特，饮誉中外。有美容效果',1,0);
